import React from "react";
import Logo from '../../images/bg-banner.png';

function test() {
    return (

        <div class="relative h-64 m-8 overflow-hidden rounded-lg ">
            <div class="absolute z-1 flex w-full h-full bg-gray-700 opacity-50">
                <div class="relative z-30 w-5/6 px-6 py-8 text-white md:py-10 md:w-1/2">
                    <h2 class="text-5xl text-white">Disph1. Bootstrap headinglay 4</h2><span></span>
                </div>
            </div>
            <div class="absolute top-0 right-0 block w-full  h-full">
                <img alt="Snowy mountain lake" class="object-cover min-w-full h-full" src={Logo} />
            </div>
        </div>


    )
}

export default test
